void parseArgs(int argc, char* args[])
{
    printf("args: %d\n", argc);
    
    
    for (int i=0; i < argc; i++)
    {
        printf("args[%d] ", i);
        printf(args[i]);
        printf("\n");
        
        if (strcmp(args[i], "-wr") == 0) // write register
        {
            doWriteRegister = 1;
            writeReg = atoi(args[++i]);
            writeVal = atoi(args[++i]);
        }

	if (strcmp(args[i], "-rd") == 0) // read register
        {
            doReadRegister = 1;
            readReg = atoi(args[++i]);            
        }

        else if (strcmp(args[i], "-list") == 0) // dump registers
        {
            doDumpRegisters = 1;
        }
        else if (strcmp(args[i], "-init") == 0)   // set initial mode
        {
            doSetInitialMode = 1;
        }	       
        else if (strcmp(args[i], "-reset") == 0)
        {
            doReset = 1;
        }     
        
        else if (strcmp(args[i], "-project") == 0)
        {
            doProject = 1;
            saveFile = args[++i];
        }
	
    }
}

/*
 * comparison function which returns â€‹a negative integer value if the first argument is less than the second, 
a positive integer value if the first argument is greater than the second and zero if the arguments are equal.
 */
 int cmp_uchar(const void *a, const void *b)
 {
     unsigned char va = * (unsigned char*) a;
     unsigned char vb = * (unsigned char*) b;
     
     if (va < vb) return -1;
     if (va == vb) return 0;
     return 1;
 }

 
